import * as React from "react";
import { Link } from "react-router-dom";

const Header = () => {
    return (
        <div className="header">
            <h1>Art Supplies</h1>

            <div>
                <Settings />
            </div>

            <nav>
                <ul className="navbar">
                    <li>
                        <Link to="/paint">Paint</Link>
                    </li>
                    <li>
                        <Link to="/pencils">Pencils</Link>
                    </li>

                </ul>
            </nav>

        </div>

    )
}

export default Header;
